import React, { Fragment, Component } from 'react';
import Element from './components/Element';
import Bottom from './components/Bottom';
import './App.css';

const apps = {
  app1: {
    name: 'Messenger',
  },
  app2: {
    name: 'YouTube',
  },
  app3: {
    name: 'Pinterest',
  },
  app4: {
    name: 'Discord',
  },
  app5: {
    name: 'Steam',
  },
  app6: {
    name: 'Snapchat',
  },
  app6: {
    name: 'Twitter',
  },
  app7: {
    name: 'Instagram',
  },
  app8: {
    name: 'Amazon',
  },
  app9: {
    name: 'WhatsApp',
  },
  app10: {
    name: 'Reddit',
  },
  app11: {
    name: 'LinkedIn',
  },
  app12: {
    name: 'Netflix',
  },
  app13: {
    name: 'Facebook',
  },
  app14: {
    name: 'Tinder',
  },
  app15: {
    name: 'SoundCloud',
  },
  app16: {
    name: 'Dribbble',
  },
  app17: {
    name: 'Uber',
  },
  app18: {
    name: 'PayPal',
  },
  app19: {
    name: 'Calm',
  },
  app20: {
    name: 'test',
  },
  app21: {
    name: 'test',
  },
  app22: {
    name: 'test',
  },
  app23: {
    name: 'test',
  },
}

class App extends Component {
  state = {
  apps,
  }

  render() {
    const { apps } = this.state;

    const AppInterface = Object.keys(apps)
    .map(app  => (
       <Element
       key={app}
       name= {apps[app].name} />
    ))
    return (
      <Fragment>
      <div className='interface'>
    <AppInterface />
      </div>
      <Bottom />
      </Fragment>
    );
  }
}

export default App;
